import React from 'react';
import CompletedItem from './Completed-item';

class CompletedList extends React.PureComponent {


    render() {
        const  {data} = this.props;
        const length = data.length;
        const listItems = length ? (
            data.map(item => {
                return (
                    <div key={item.id}>
                        <span className="name ">{item.name}</span>
                        <span className="action icon" >&times;</span>
                        <span className="action icon" >&radic;</span>
                    </div>
                )
            })
        ) : (
                <p>No Completed Tasks to show</p>
            )
        return (
            <>
                <div className="completedList">
                    <span className="name title">Complete</span>
                    <CompletedItem />
                </div>

            </>

        )

    }
}


const mapStateToProps = state => ({
    data: state.items,
});


const mapDispatchToProps = dispatch => ({
    setCompleteData: data => dispatch(GetsData(data)),
});


export default connect(mapStateToProps, mapDispatchToProps)(CompletedList);
